import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "./components/Home";

function App() {
  return (
      <Router>
        <div className="App">
          <Switch>
            <Route path="/createUser">

            </Route>
            <Route path="/updateUser">

            </Route>
            <Route path="/deleteUser">

            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </div>
      </Router>
  );
}

export default App;
